import React from "react";

const MainImage = ({ topImage }) => {
  return (
    <div className="top">
      <img
        src={"https://image.tmdb.org/t/p/w1000/" + topImage.backdrop_path}
        alt=""
      />
      {/*   {topImage.original_title} */}
    </div>
  );
};

export default MainImage;
